  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import { Playground } from 'docz'
import Stage from '../stage'
import { NineSlicePlane } from '../index'

export default ({components, ...props}) => <MDXTag name="wrapper"  components={components}>
<MDXTag name="h1" components={components} props={{"id":"ninesliceplane"}}>{`NineSlicePlane`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"props"}}>{`Props`}</MDXTag>
<MDXTag name="p" components={components}><MDXTag name="a" components={components} parentName="p" props={{"href":"http://pixijs.download/dev/docs/PIXI.mesh.NineSlicePlane.html"}}>{`http://pixijs.download/dev/docs/PIXI.mesh.NineSlicePlane.html`}</MDXTag></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"usage"}}>{`Usage`}</MDXTag>
<Playground __position={0} __code={`<Stage width={500} height={300} options={{ backgroundColor: 0xeef1f5 }}>
  <NineSlicePlane
    anchor={new PIXI.Point(200, 100)}
    pivot={new PIXI.Point(200, 100)}
    leftWidth={50}
    topHeight={30}
    rightWidth={60}
    bottomHeight={180}
    width={400}
    height={300}
    x={250}
    y={120}
    image="https://s3-us-west-2.amazonaws.com/s.cdpn.io/693612/speech_bubble.png"
  />
</Stage>`} __scope={{props,Stage,NineSlicePlane}}>
  <Stage width={500} height={300} options={{ backgroundColor: 0xeef1f5 }}>
    <NineSlicePlane 
      anchor={new PIXI.Point(200, 100)}
      pivot={new PIXI.Point(200, 100)}
      leftWidth={50}
      topHeight={30}
      rightWidth={60}
      bottomHeight={180}
      width={400}
      height={300}
      x={250}
      y={120}
      image="https://s3-us-west-2.amazonaws.com/s.cdpn.io/693612/speech_bubble.png" />
  </Stage>
</Playground>
<MDXTag name="h2" components={components} props={{"id":"example"}}>{`Example`}</MDXTag>
<iframe 
  height={500} 
  scrolling="no"
  title="Nine Slice Plane"
  src="//codepen.io/inlet/embed/8bf47b3e9a4539c472ea2836780c59eb/?height=300&theme-id=33987&default-tab=result&embed-version=2"
  frameBorder="no" 
  allowFullScreen={true}
  style={{ width: '100%' }} /></MDXTag>
